    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        writeln!(f, "{}", write_headers())?;
        self.config.fmt_with_schema(
            f,
            self.introspection_data.as_ref(),
            &self.secondary_indices,
        )?;
        write!(
            f,
            "{}",
            self.nodes
                .iter()
                .map(|n| format!("{n}"))
                .collect::<Vec<_>>()
                .join("\n")
        )?;
        writeln!(f)?;
        write!(
            f,
            "{}",
            self.edges
                .iter()
                .map(|e| format!("{e}"))
                .collect::<Vec<_>>()
                .join("\n")
        )?;
        writeln!(f)?;
        write!(
            f,
            "{}",
            self.vectors
                .iter()
                .map(|v| format!("{v}"))
                .collect::<Vec<_>>()
                .join("\n")
        )?;
        writeln!(f)?;
        write!(
            f,
            "{}",
            self.queries
                .iter()
                .map(|q| format!("{q}"))
                .collect::<Vec<_>>()
                .join("\n")
        )?;
        writeln!(f)?;
        writeln!(
            f,
            "{}",
            self.migrations
                .iter()
                .map(|m| format!("{m}"))
                .collect::<Vec<_>>()
                .join("\n")
        )?;
        Ok(())
    }
}
